import React from 'react';
import '../styles.css'

export default class NavBar extends React.Component {

    render() {
        return(
            <div className="NavBar">
                <table className="">
                    <tbody>
                        <tr>
                            <td className="NavTab">
                                <p className="NavItem">Home</p>
                            </td>
                            <td className="NavTab">
                                <p className="NavItem">Portfolio</p>
                            </td>
                            <td className="NavTab">
                                <p className="NavItem">About</p>
                            </td>
                        </tr>
                    </tbody>
                </table>
            </div>
        );
    }
}
